import React, {useState } from 'react';
import Header from './Header'

function App() {
  const [counter, setCounter] = useState(0);

  const increment = () => {
    setCounter( counter++ );
  }

  return (
    <div>
      <Header>Counter: {counter}</Header>
      <button onclick={increment}>Increment</button>
    </div>

  );
}

export default App;
